  \"2015-09-27T00:08:07.503536\",\n\t\"name\": \"dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-dfab80\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108219 includes chemical,
  discrete sample, physical and profile data collected from HUDSON in the Davis Strait,
  Labrador Sea and North Atlantic Ocean from 2003-07-13 to 2003-08-04 and retrieved
  during cruise 18HU20030713 (18HU200307_1 and HUD2003-038). These data include ALKALINITY,
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE,
  Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE and methyl
  chloroform (MC). The instruments used to collect these data include Alkalinity titrator,
  CTD, Coulometer for DIC measurement and bottle. These data were collected by Robert
  Gershey of BDR Research Ltd and Peter E. (retired) Jones of Bedford Institute of
  Oceanography as part of the CLIVAR_AR07W_2003 data set.nnThe International CLIVAR
  Global Ocean Carbon and Repeat Hydrography Program carries out a systematic and
  global re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes
  in storage and transport of heat, fresh water, carbon dioxide (CO2), and related
  parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
